INSERT INTO `regislets` (`id`, `name`, `effects`, `max_level`, `image_location`, `description`) VALUES
(1, 'Accuracy Boost', 'Increases Accuracy by 1 per Regislet Level', 10, '', ''),
(2, 'Arrow Rain Enhancer', 'An additional attack is added to the skill \"Arrow Rain\" (+1 hit per Level)', 2, 'sk_rain_arrow', ''),
(3, 'Assassin Stab Enhancer', 'Raises the power of \"Assassin Stab\" by (1% per Registe Level)%. Furthermore, the accuracy is raised by (10  Registlet Level)% if it is Back Stab.', 10, 'sk_assassin_stab', ''),
(4, 'Attack Speed Boost', 'Increases ASPD by 1 per Regislet Level', 100, '', ''),
(5, 'Attacker\'s Pet', 'Raises the damage dealt by pet by 3% per Registlet Level, but greatly decreases its owner\'s', 10, '', ''),
(6, 'Dark Talent', 'Sets skill effects that change based on element to dark element', 1, '', ''),
(7, 'Parrier Storm Blaze', 'A Guard check is added to the skill \"Storm Blaze\". A successful Guard will double the amount of MP recovered', 1, 'sk_storm_blaze', ''),
(8, 'Sneak Attack Timer', 'The skill \"Sneak Attack\" changes into a time-based buff instead of remaining use-based', 1, 'sk_sneak_attack', ''),
(9, 'Invincible Dauntless', '\"Dauntless\" accumulates 1 second faster, but the count will decrease by 9(- 3 per Regislet Level) when taking damage. However, it won\'t decrease if the damage is blocked with Guard or certain Mononofu skills', 3, 'sk_dauntless', ''),
(10, 'Evasion Set', 'Evasion becomes usable even with equipment that doesn\'t allow it', 1, '', ''),
(11, 'Knight\'s Intuition', 'Anticipate increases by 5% if a one-handed sword is equipped, Equipping a shield will triple the amount increased', 5, '', ''),
(12, 'Distant Buster Lance', 'Increases the power of \"Buster Lance\" by (10% per Regislet Level). The range and distance at which the power starts to weaken is Increased, making it always a long-range attack', 10, 'sk_buster_lance', ''),
(13, 'Magic: Storm Extender', 'Lowers the power of \"Magic: Storm\" by 50% to make its effect last 1s(+1s per Regislet Level) longer', 5, 'sk_magic_storm', ''),
(14, 'Role Model', 'Greatly suppresses your own damage output to increase your party members\' EXP Gain by 1(+1 per Regislet Level)%', 10, '', ''),
(15, 'Damage Check', 'Displays an additional warning message when stepping on a warning area if the damage from the attack exceeds 50% of your current HP', 1, '', ''),
